//https://reacttraining.com/react-router/web/example/basic
import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, /*Link,*/ NavLink } from "react-router-dom";
import Solution from './Solution';
import Home from './Home';
import Cartoonizer from './Cartoonizer';
import Birthday from './Birthday';
import Contact from './Contact';
import Header from './Header';
import {ThemeContext, themes} from './theme-context';


class App extends Component {
  render() {
    return (
       <ThemeContext.Provider value={themes.en}>
          <Header>
          </Header> 
       <Router>
       <div className="navbar navbar-expand-md  navbar-dark">
			<div className="container">
					<div className="navbar-header">
					<button className="navbar-toggle" data-toggle="collapse" data-target=".navbarCollapse">					
						<span className="iconBar"></span>
						<span className="iconBar"></span>
						<span className="iconBar"></span>
					</button>
					</div>
					<div className="navbarCollapse">
        <ul className="spisokUl">
          <li className="current">
            <NavLink  exact={true} to="/frontend">Home</NavLink>
          </li>
          <li>
            <NavLink to="/frontend/solution">Solution for Blind People</NavLink>
          </li>
          <li>
            <NavLink to="/frontend/birthday">Birthday Present</NavLink>
          </li>
          <li>
            <NavLink to="/frontend/cartoonizer">Cartoonizer</NavLink>
          </li>
          <li>
            <NavLink to="/frontend/contact">Contact Us</NavLink>
          </li>
        </ul>
        <Route exact path="/" component={Home} />
        <Route exact path="/frontend" component={Home} />
        <Route exact path="/frontend/solution" component={Solution} />
        <Route exact path="/frontend/birthday" component={Birthday} />
        <Route exact path="/frontend/cartoonizer" component={Cartoonizer} />
        <Route exact path="/frontend/contact" component={Contact} />
        <Route exact path="/frontend/header" component={Header} />
        </div>
			</div>
		</div>
    </Router>
    </ThemeContext.Provider>
    );
  }
}

export default App;
